def all_ints_not_div_by_num(lst):
    result = []

    for num in lst[15:92]:
        if num % 59 != 0:
            result.append(num)

    return result
```
Note: The provided code assumes that the list passed as an argument is inclusive of index 15 but exclusive of index 92. If the intention is to include index 92 as well, the range in the for loop should be modified to `lst[15:93]`.
